import logo from './logo.svg';
import './App.css';

import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Portfolio from './components/portfolio'


function App() {
  return (
    <Router>
      <Routes>
        <Route path='/'>
          <Portfolio />
        </Route>
        <Route path='/portfolio'>
          <Portfolio />
        </Route>
      </Routes>
    </Router>
    );
}

export default App;
